	/* Mtodo para obtener la lista de correos origen */
	public List<GetSendersListSenders> getSenders() {
		List<GetSendersListSenders> salida=null;
		//Set API KEY
		ApiClient defaultClient = Configuration.getDefaultApiClient();
		ApiKeyAuth apiKey = (ApiKeyAuth) defaultClient.getAuthentication("api-key");
	    apiKey.setApiKey(API_KEY);
	    // Sender
	    SendersApi apiInstanceSender = new SendersApi();
   	 	try {
			GetSendersList result = apiInstanceSender.getSenders(null, null);
			salida=result.getSenders();			
		} catch (ApiException e) {
			logger.error("Error en mtodo getSenders: {}",e.getMessage());
			throw new ResponseStatusException(HttpStatus.INTERNAL_SERVER_ERROR, e.getMessage());
		}
   	 	return salida;
	}
	
	/* Mtodo para enviar correo electrnico */
	public Boolean sendEmail(Email email) {
		Boolean salida = false;
		Boolean fFile=false;
		List<SendSmtpEmailTo> emails = new ArrayList<SendSmtpEmailTo>();
		List<SendSmtpEmailAttachment> attachs = new ArrayList<SendSmtpEmailAttachment>();
		// Set API KEY
		ApiClient defaultClient = Configuration.getDefaultApiClient();
		ApiKeyAuth apiKey = (ApiKeyAuth) defaultClient.getAuthentication("api-key");
		apiKey.setApiKey(API_KEY);
		// Set Sender
		SendSmtpEmailSender sender = new SendSmtpEmailSender();
		sender.setId(email.getSenderId());
		// Add Emails
		if (email.getTo() != null) {
			for (String correo : email.getTo()) {
				SendSmtpEmailTo n = new SendSmtpEmailTo();
				n.setEmail(correo);
				emails.add(n);
			}
		} else {
			logger.error("Error en mtodo sendEmail: Lista de correos vacia");
			throw new ResponseStatusException(HttpStatus.BAD_REQUEST, "Lista de correos vacia");
		}
		// Add Attach's
		if (email.getFiles() != null) {
			for (EmailFile file : email.getFiles()) {
				SendSmtpEmailAttachment at = new SendSmtpEmailAttachment();
				at.setName(file.getName());
				if(file.getContentBase64()!=null) {
					at.setContent(Base64.getDecoder().decode(file.getContentBase64()));
					fFile=true;
				}
				if(fFile) {
					attachs.add(at);
				}											
			}

		}
		// Create SendSmtpEmail Object
		TransactionalEmailsApi apiInstance = new TransactionalEmailsApi();
		SendSmtpEmail sendSmtpEmail = new SendSmtpEmail();
		sendSmtpEmail.sender(sender);
		sendSmtpEmail.setTo(emails);
		sendSmtpEmail.setSubject(email.getSubject());
		sendSmtpEmail.setHtmlContent(email.getHtmlBody());
		//Add Tags ( 0 - Origen, 1- Motivo, 2- Identificador / TAG, 3-user )
		sendSmtpEmail.addTagsItem(email.getSclave().toUpperCase().trim());
		sendSmtpEmail.addTagsItem(email.getMotivo().toString());
		sendSmtpEmail.addTagsItem(email.getTag());
		sendSmtpEmail.addTagsItem(email.getUser_reg());
		if (attachs.size() > 0) {
			sendSmtpEmail.setAttachment(attachs);
		}
		if (email.getReplyTo() != null) {
			SendSmtpEmailReplyTo r = new SendSmtpEmailReplyTo();
			r.setEmail(email.getReplyTo());
			sendSmtpEmail.setReplyTo(r);
		}
		if (email.getBcc() != null) {
			SendSmtpEmailBcc b = new SendSmtpEmailBcc();
			b.setEmail(email.getBcc());
			sendSmtpEmail.addBccItem(b);
		}
		try {
			CreateSmtpEmail result = apiInstance.sendTransacEmail(sendSmtpEmail);
			logger.debug("REspuesta del correo:  {}", result);
			logger.info("Respuesta de envio de correo:  {}", result);
			salida = true;
		} catch (Exception e) {
			logger.error("Error en mtodo sendEmail: {}", e.getMessage());
			throw new ResponseStatusException(HttpStatus.INTERNAL_SERVER_ERROR, e.getMessage());
		}
		return salida;
	}
	
	
	/* Mtodo para registrar la trazabilidad de un correo electrnico */
	public Boolean registerTraceability(Webhook webhook) {
		Bitacora bitacora= new Bitacora();
		Date tmpDate;
		logger.info("WebhookId : {}",webhook.getWebhookid());
		logger.info("Email     : {}",webhook.getEmail());
		logger.info("Subject   : {}",webhook.getSubject());		
		logger.info("Event     : {}",webhook.getEvent());
		logger.info("Link      : {}",webhook.getLink());
		logger.info("Reason    : {}",webhook.getReason());
		logger.info("Date      : {}",webhook.getDate());
		logger.info("SendingIP : {}",webhook.getSending_ip());
		logger.info("MessageId : {}",webhook.getMessageId());
		logger.info("TemplateId: {}",webhook.getTemplateid());
		logger.info("Tag       : {}",webhook.getTag());				
		if(webhook.getTags()!=null) {
			if(webhook.getTags().size()>=1) {
				for (String t : webhook.getTags()) {
					logger.info("Tag      : {}",t.toString());
				}
			}else{
				logger.info("Tags      : {}","null");
			}
		}
		logger.info("Ts        : {}",webhook.getTs());
		logger.info("TsEvent   : {}",webhook.getTs_event());
		logger.info("TsEpoch   : {}",webhook.getTs_epoch());
		try {
			bitacora.setSclave(webhook.getTags().get(0));
			bitacora.setKmotivo(Long.valueOf(webhook.getTags().get(1)));
			bitacora.setStag(webhook.getTags().get(2));
			bitacora.setScorreoelectronico(webhook.getEmail());
			bitacora.setSasunto(webhook.getSubject());
			bitacora.setSwebhookid(webhook.getWebhookid());
			bitacora.setSevento(webhook.getEvent());
			tmpDate=new SimpleDateFormat("yyyy-MM-dd HH:mm:ss").parse(webhook.getDate());  
			bitacora.setDevento(tmpDate);
			bitacora.setUser_reg(webhook.getTags().get(3));
			bitacora.setSlink(webhook.getLink());
			bitacora.setSreason(webhook.getReason());
			bitacora.setSsendingip(webhook.getSending_ip());
			bitacora.setSmessageid(webhook.getMessageId());
	        bitacoraService.saveBitacora(bitacora);
		} catch (Exception e) {			
			e.printStackTrace();
			logger.error("Error en mtodo registerTraceability: {}", e.getMessage());
			throw new ResponseStatusException(HttpStatus.INTERNAL_SERVER_ERROR, e.getMessage());
		}		
        return true;
	}
	
		
	/* Mtodo para enviar correo electronico con adjuntos (base64) */
	public Boolean sendEmailWithAttach_B64(String tag,Long SenderFrom,List<String> correos, String subject,String body,String replyTo,String bcc,List<String> base64Files,List<String> nameFiles) {
		Boolean salida=false;
		List<SendSmtpEmailTo> emails=new ArrayList<SendSmtpEmailTo>();
		List<SendSmtpEmailAttachment> attachs= new ArrayList<SendSmtpEmailAttachment>();
		//Set API KEY
		ApiClient defaultClient = Configuration.getDefaultApiClient();
		ApiKeyAuth apiKey = (ApiKeyAuth) defaultClient.getAuthentication("api-key");
	    apiKey.setApiKey(API_KEY);
	    // Set Sender 
	    SendSmtpEmailSender sender= new SendSmtpEmailSender();
	    sender.setId(SenderFrom);
	    // Add Emails
	    if(correos!=null) {
	    	for (String email : correos) {
	    		SendSmtpEmailTo n=new SendSmtpEmailTo();
	    		n.setEmail(email);
	    		emails.add(n);
			}
	    }else {
	    	logger.error("Error en mtodo sendEmail: Lista de correos vacia");
			throw new ResponseStatusException(HttpStatus.BAD_REQUEST, "Lista de correos vacia");
	    }
	    if(base64Files!=null && nameFiles!=null) {
	    	if(base64Files.size()==nameFiles.size()) {
	    		for (String file : base64Files) {
					for (String nameFile : nameFiles) {
						SendSmtpEmailAttachment at= new SendSmtpEmailAttachment();
						at.setContent(Base64.getDecoder().decode(file));
						at.setName(nameFile);
						attachs.add(at);
					}
				}
		    }else {
		    	logger.error("Error en mtodo sendEmailWithAttach_B64: Lista de base64Files & nameFiles de diferente tamao");
				throw new ResponseStatusException(HttpStatus.BAD_REQUEST, "Lista de base64Files & nameFiles de diferente tamao");
		    }
	    }	
	    // Create SendSmtpEmail Object
	    TransactionalEmailsApi apiInstance = new TransactionalEmailsApi();
	    SendSmtpEmail sendSmtpEmail = new SendSmtpEmail();	    
	    sendSmtpEmail.sender(sender);
	    sendSmtpEmail.setTo(emails);
	    sendSmtpEmail.setSubject(subject);
	    sendSmtpEmail.setHtmlContent(body);
	    sendSmtpEmail.addTagsItem(tag);
	    if(attachs.size()>0) {
	    	sendSmtpEmail.setAttachment(attachs);
	    }	    
	    if(replyTo!=null) {
	    	SendSmtpEmailReplyTo r=new SendSmtpEmailReplyTo();
	    	r.setEmail(replyTo);
	    	sendSmtpEmail.setReplyTo(r);
	    }
	    if(bcc!=null) {
	    	SendSmtpEmailBcc b=new SendSmtpEmailBcc();
	    	b.setEmail(bcc);
	    	sendSmtpEmail.addBccItem(b);
	    }
	    try {
	    	 CreateSmtpEmail result = apiInstance.sendTransacEmail(sendSmtpEmail);
	    	 logger.debug("REspuesta del correo:  {}",result);
	    	 salida=true;
		} catch (Exception e) {
			logger.error("Error en mtodo sendEmail: {}",e.getMessage());
			throw new ResponseStatusException(HttpStatus.INTERNAL_SERVER_ERROR, e.getMessage());
		}	    
		return salida;
	}
				
	
